@na1a_budoolerrr the most difficult ship for me to talk about...
1. I don't ship it because... I just like them better as best bros. Friends that goof off and hate each other sometimes
2. I would have liked it if... I don't know, if I felt they could actually get along in a romantic relationship?

@Rose3Writes Ingrid is *absolutely* chaotic!! 
She kicks a freaking door down in her Bernie support!! It was *literally* unhinged!!!
I like translating that energy into a more goofy, excitable Ingrid in my writing. She smiles, and teases, and can be physically affectionate (light shoves, etc)
